import React, {useState} from 'react';
import ReactDOM from 'react-dom';
import contact from './contacts'

var lp = window.location.pathname.slice(1)
lp = lp.replace(/%20/g, " ")

function Taoanh () {
    var srcc = "/img/" + lp + "/" + 1 + ".png"
    return (
        <div>
            <img src = {srcc}></img>
        </div>
    )
}

export default Taoanh
